import logo from './logo.svg';
import './App.css';
import { useState, useEffect } from 'react';

function App() {
  const [contactsData, setContactsData] = useState(new Array(1000));

  useEffect(() => {
    const getData = async () => {
      const data = await fetchData();
      setContactsData(data);
    };

    getData();
  }, []);

  const fetchData = async () => {
    const res = await fetch('https://teacode-recruitment-challenge.s3.eu-central-1.amazonaws.com/users.json');
    const data = await res.json();

    return data;
  };

  return (
    <div>
      <p>{contactsData[5].id}</p>
      {contactsData.map(contact => {<p>{contact.id}</p>})}

    </div>
  );
}

export default App;
